import "./App.css";
import News from "./News/News";
import useFetch from "./useFetch";

function App() {
  const { data, loading, error } = useFetch(
    "http://hn.algolia.com/api/v1/search?query=test"
  );

  if (loading) {
    return <div>Loading</div>;
  }

  if (error) console.log(error);

  return (
    <>
      <div className="App">
        <nav className="navbar nav-expand navbar-dark bg-primary fixed-top">
          <div className="navbar-nav fs-6 text-white">
            <h1>HACKER NEWS <i class="bi bi-code-square"/></h1>
          </div>
        </nav>
        <h1 className="mt-5 p-5">TODAY'S HEADLINES</h1>

        <News data={data} />
      </div>
    </>
  );
}

export default App;
